import React from "react";
import "../style/card.css";

const Card = () => {
  return (
    <>
      <div className="card-container">
        <input
          type="text"
          name=""
          id="search"
          placeholder="Search for the name of a bus service, flight service or a hotel"
          className="search-box"
        />
      </div>
    </>
  );
};

export default Card;
